import React from "react";
import styled from "styled-components";
const StyleFooter = styled.div`
background-color : ${props => props.theme.grayColor};
margin-top: 5rem;
padding: 2rem;
.footer {
    &-list {
        display: grid;
        grid-template-columns: repeat(4, 1fr);
    }
    &-heading {
        font-size: 1.6rem;
        color: ${props => props.theme.textPrimary};;
    }
    &-text {
        margin-top: 2rem;
        font-size: 1.4rem;
    }
    &-pay {
        display: grid;
        grid-template-columns: repeat(3, 1fr);
        gap: 1rem;
        &__img {
            width: 67px;
            height: 40px;
        }
    }
}
`;

const Footer = () => {
  return (
    <StyleFooter>
      <div className="container">
        <div className="footer-list">
          <div className="footer-items">
            <p className="footer-heading">Showroom tại TP. Hồ Chí Minh</p>
            <p className="footer-text">
              Số 62, Yên Đỗ, Phường 1, Bình Thạnh, TP. Hồ Chí Minh
            </p>
            <img src="/footer-1.svg" alt="" style={{width: "180px", height: "69px"}}/>
            <img src="/footer-2.png" alt="" />
          </div>
          <div className="footer-items">
            <p className="footer-heading">Phương thức thanh toán </p>
            <div className="footer-pay">
                <img src="/visa.svg" alt="" className="footer-pay__img"/>
                <img src="/mastercard.svg" alt="" className="footer-pay__img"/>
                <img src="/jcb.svg" alt="" className="footer-pay__img"/>
                <img src="/cash.svg" alt="" className="footer-pay__img"/>
                <img src="/internet-banking.svg" alt="" className="footer-pay__img"/>
            </div>
            <p className="footer-title"> Tải ứng dụng điện thoại </p>
            <img src="" alt="" />
            <img src="" alt="" />
            <p className="footer-title">Kết nối với chúng tôi</p>
            <div className="footer-social">
              <img src="/facebook.png" alt="" />
              <img src="/twitter.png" alt="" />
              <img src="/pinterest.png" alt="" />
              <img src="/youtube.png" alt="" />
            </div>
          </div>
          <div className="footer-items">
            <p className="footer-heading">Hỗ trợ khách hàng</p>
            <p className="footer-text">Giới thiệu</p>
            <p className="footer-text">Chính sách đổi trả</p>
            <p className="footer-text">Hướng dẫn đặt hàng</p>
            <p className="footer-text">Vận chuyển & Giao nhận</p>
            <p className="footer-text">Đăng ký bán hàng trên chiaki</p>
            <p className="footer-text">Cam kết bảo mật thông tin</p>
            <p className="footer-text">Cơ chế giải quyết tranh chấp</p>
            <p className="footer-text">Quy chế hoạt động</p>
            <p className="footer-text">Liên hệ</p>
            <p className="footer-text">Đăng ký cộng tác viên</p>
            <p className="footer-text">Sơ đồ Website</p>
          </div>
          <div className="footer-items">
            <div className="footer-items__content">
                <p className="footer-heading">CSKH<span className="footer-number">0932.888.300</span></p>
                <p className="footer-heading">Cộng tác viên<span className="footer-number">0964.406.660</span><span className="footer-number">0969.879.075</span></p>
                <p className="footer-heading">Khiếu nại<span className="footer-number">0985.409.885</span></p>
                <p className="footer-heading">Khiếu nại<span className="footer-number">0964.898.762</span></p>
            </div>
            <p className="footer-heading">Đăng ký nhận khuyến mãi từ Chiaki.vn</p>
            <p className="footer-text">Đừng bỏ lỡ hàng ngàn sản phẩm và chương trình siêu hấp dẫn</p>
          </div>
        </div>
      </div>
    </StyleFooter>
  );
};

export default Footer;
